tbh i did the math a while ago

if you're single, its really really hard to even breach $30k/m ($1000 a day)

you need to be ostentatious, actively shopping for branded goods and jewelry (female trait), addicted to a vice, partying hard and taking care of free loading parasites

conversely, its rarely worth the work to manage OPM$ if youre already a profitable trader with a reasonably sized bankroll

if 50m OPM$ = 7m own money (~7x factor)

you quickly realize its significantly easier to achieve higher returns when allocating a total portfolio 7x smaller
